DROP TABLE IF EXISTS `wormhole_systems`;
CREATE TABLE `wormhole_systems` (
  `id` int unsigned NOT NULL,
  `system` varchar(8) NOT NULL,
  `class` int NOT NULL,
  `star` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `planets` int unsigned NOT NULL,
  `moons` int unsigned NOT NULL,
  `effect` varchar(64) DEFAULT NULL,
  `static` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `system` (`system`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

LOCK TABLES `wormhole_systems` WRITE;


UNLOCK TABLES;

DROP TABLE IF EXISTS `wormhole_classes`;

CREATE TABLE `wormhole_classes` (
  `id` int unsigned NOT NULL,
  `hole` varchar(16) NOT NULL,
  `in_class` int NOT NULL,
  `maxStableTime` bigint NOT NULL,
  `maxStableMass` bigint NOT NULL,
  `massRegeneration` bigint NOT NULL,
  `maxJumpMass` bigint NOT NULL,
  PRIMARY KEY (`id`),
  KEY `hole` (`hole`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

LOCK TABLES `wormhole_classes` WRITE;


UNLOCK TABLES;
